pg;base64,","IsAddSupported":true,"IsConnectedAccountsSupported":false,"ClassificationsList":[9],"FlairState":0,"IsInlineConfigConnector":true},{"Id":"32a5e6c4-c9dd-4c12-89a8-34d2c496312f","Name":"ConnectToO365","Title":"SignalFx","Description":"Share dashboards and receive real-time alerts from SignalFx","ImagePath":"data:image/jpg;base64,","IsAddSupported":true,"IsConnectedAccountsSupported":false,"ClassificationsList":[9],"FlairState":0,"IsInlineConfigConnector":false},{"Id":"01ea66d6-db2b-4ef5-8579-d537c7920d84","Name":"ConnectToO365Inline","Title":"awork","Description":"awork Connector is the smart Microsoft Teams assistant to manage your projects","ImagePath":"data:image/jpg;base64,","IsAddSupported":true,"IsConnectedAccountsSupported":false,"ClassificationsList":[9],"FlairState":0,"IsInlineConfigConnector":true},{"Id":"79068c5d-c9dc-4911-8c18-62ea4c58b7b3","Name":"ConnectToO365Inline","Title":"Bleemeo","Description":"Receive your Bleemeo notifications within Microsoft Teams.","ImagePath":"data:image/jpg;base64,","IsAddSupported":true,"IsConnectedAccountsSupported":false,"ClassificationsList":[9],"FlairState":0,"IsInlineConfigConnector":true},{"Id":"76787555-66f7-4b6e-9e1e-2bc81d58fec1","Name":"ConnectToO365Inline","Title":"QuandaGo Collaborative Case Management","Description":"QuandaGo Collaborative Case Management","ImagePath":"data:image/jpg;base64,","IsAddSupported":true,"IsConnectedAccountsSupported":false,"ClassificationsList":[9],"FlairState":0,"IsInlineConfigConnector":true},{"Id":"e21a393e-21a2-420c-892b-3d9e35d81c52","Name":"ConnectToO365Inline","Title":"Summize Assistant","Description":"Summize makes reviewing contracts easy.","ImagePath":"data:image/jpg;base64,","IsAddSupported":true,"IsConnectedAccountsSupported":false,"ClassificationsList":[9],"FlairState":0,"IsInlineConfigConnector":true}]
'@
# Convert the raw json to json objects
$FirstPartyConnectors = $FirstPartyConnectorsRaw | ConvertFrom-Json
$ThirdPartyConnectors = $ThirdPartyConnectorsRaw | ConvertFrom-Json

# Alternatively you can get the Connector Id's this way
#$FirstPartyConnectors = Invoke-RestMethod https://outlook.office.com/connectors/Manage/FirstPartyConnectorType
#$ThirdPartyConnectors = Invoke-RestMethod https://outlook.office.com/connectors/Manage/ThirdPartyConnectorType

# Connect to tenant
Connect-MgGraph -Scopes "Team.ReadBasic.All", "TeamsAppInstallation.ReadForTeam", "AppCatalog.Read.All" -NoWelcome

# Get all teams in the tenant
$Teams = Get-MgTeam

# Create an empty array to hold the results
$results = @()

# Loop through each team and list installed apps
$TeamCount = 1
foreach ($Team in $Teams) {
    $TeamId = $Team.Id
	Write-Host "Processing team '$($Team.DisplayName) ($TeamId)' ($TeamCount/$($Teams.count))"
    $installedApps = Get-MgTeamInstalledApp -TeamId $teamId -ExpandProperty "teamsApp","teamsAppDefinition"
    foreach ($app in $installedApps) {
        $obj = [PSCustomObject]@{
            "TeamId" = $TeamId
            "TeamName" = $Team.DisplayName
            "TeamAppJoinUniqueId" = $app.Id
            "TeamsAppId" = $app.TeamsApp.Id
            "TeamsAppName" = $app.TeamsApp.DisplayName
            "TeamsAppDistributionMethod" = $app.TeamsApp.DistributionMethod
            "TeamsAppDescription" = $app.TeamsAppDefinition.Description
            "TeamsAppShortDescription" = $app.TeamsAppDefinition.ShortDescription
			"IsConnector" = if ($app.TeamsApp.Id -in $FirstPartyConnectors.Id -or $app.TeamsApp.Id -in $ThirdPartyConnectors.Id) { $true } else { $false }
        }
        $results += $obj
    }
	$TeamCount++
}

# List all teams that have a connector added
$results | ?{$_.IsConnector -eq $true} | Sort-Object -Property TeamsAppName | ft TeamName,TeamsAppId,TeamsAppName,TeamsAppShortDescription,IsConnector